import React, { Component } from "react";

class Track extends Component {
	
	onMouseOver(item) {
		console.log(item);
	}
	
	
	render () {
		return (
			<p style={{position: "relative", border: "solid 1px black", width: "10%", left: "5%", top: "50px" }} onMouseOver={(e, val) => { this.expand(val); }}>Song</p>
		);
	}
}

export default Track;
